import React from "react";

function App() {
  const onClickButton = () => alert("Button clicked");
  const contentStyle = {
    color: "#00babc",
    fontSize: "20px",
  };
  return (
    <>
      <h1>Hello World!</h1>
      <p style={contentStyle}>42Lisbon : Lisbon</p>
      <button onClick={onClickButton}>Click Here :)</button>
    </>
  );
}

export default App;
